  const addFavourite = (movie) => {
    setFavourites([...favourites, movie]);
  }

  console.log(favourites);

  return (
    <div className="App">
      <SearchMovies addFav={addFavourite}/>
      <FavouritesList favour/>
    </div>
  );
}

export default App;
